import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { getImageURL } from '../../services/api';
import './MyBookings.css';

function MyBookings() {
  const navigate = useNavigate();
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Load bookings from localStorage
    const loadBookings = () => {
      try {
        console.log('üìã Loading bookings from localStorage...');
        const savedBookings = localStorage.getItem('bookings');
        
        if (savedBookings) {
          const parsedBookings = JSON.parse(savedBookings);
          console.log('‚úÖ Bookings found:', parsedBookings);
          setBookings(parsedBookings);
        } else {
          console.log('‚ÑπÔ∏è No bookings found in localStorage');
          setBookings([]);
        }
        
        setLoading(false);
      } catch (error) {
        console.error('‚ùå Error loading bookings:', error);
        setBookings([]);
        setLoading(false);
      }
    };

    loadBookings();
  }, []);

  const formatDate = (dateString) => {
    if (!dateString) return 'N/A';
    return new Date(dateString).toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'long',
      day: 'numeric'
    });
  };

  const formatTime = (timeString) => {
    if (!timeString) return 'N/A';
    return timeString;
  };

  const getStatusColor = (status) => {
    switch(status?.toLowerCase()) {
      case 'confirmed':
        return '#27ae60';
      case 'completed':
        return '#3498db';
      case 'cancelled':
        return '#e74c3c';
      default:
        return '#f39c12'; // pending
    }
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>Loading bookings...</p>
      </div>
    );
  }

  return (
    <div className="my-bookings-container">
      <div className="bookings-header">
        <div>
          <h1>My Bookings</h1>
          <p>View your booking history</p>
        </div>
        <button className="back-btn" onClick={() => navigate('/')}>
          ‚Üê Back to Home
        </button>
      </div>

      {bookings.length === 0 ? (
        <div className="no-bookings">
          <div className="no-bookings-icon">üìÖ</div>
          <h2>You haven't made any bookings yet</h2>
          <p>Start exploring our collection and book your favorite artwork!</p>
          <button className="browse-btn" onClick={() => navigate('/')}>
            Browse Artworks
          </button>
        </div>
      ) : (
        <div className="bookings-grid">
          {bookings.map((booking, index) => (
            <div key={index} className="booking-card">
              <div className="booking-card-header">
                <span className="booking-id">Booking #{index + 1}</span>
                <span 
                  className="booking-status"
                  style={{ backgroundColor: getStatusColor(booking.status || 'pending') }}
                >
                  {(booking.status || 'PENDING').toUpperCase()}
                </span>
              </div>

              <div className="booking-artwork">
                <img 
                  src={getImageURL(booking.artwork?.image_url)} 
                  alt={booking.artwork?.title}
                  onError={(e) => {
                    e.target.src = 'https://via.placeholder.com/150x180?text=No+Image';
                  }}
                />
                <div className="booking-artwork-info">
                  <h3>{booking.artwork?.title}</h3>
                  <p className="booking-artist">By {booking.artwork?.artist_name}</p>
                  <p className="booking-price">NPR {Number(booking.artwork?.price || 0).toLocaleString()}</p>
                </div>
              </div>

              <div className="booking-divider"></div>

              <div className="booking-details">
                <div className="detail-item">
                  <span className="detail-icon">üë§</span>
                  <div>
                    <span className="detail-label">Name</span>
                    <span className="detail-value">{booking.fullName}</span>
                  </div>
                </div>

                <div className="detail-item">
                  <span className="detail-icon">üìß</span>
                  <div>
                    <span className="detail-label">Email</span>
                    <span className="detail-value">{booking.email}</span>
                  </div>
                </div>

                <div className="detail-item">
                  <span className="detail-icon">üì±</span>
                  <div>
                    <span className="detail-label">Phone</span>
                    <span className="detail-value">{booking.phone}</span>
                  </div>
                </div>

                <div className="detail-item">
                  <span className="detail-icon">üìÖ</span>
                  <div>
                    <span className="detail-label">Date</span>
                    <span className="detail-value">
                      {formatDate(booking.bookingDate)}
                    </span>
                  </div>
                </div>

                <div className="detail-item">
                  <span className="detail-icon">üïê</span>
                  <div>
                    <span className="detail-label">Time</span>
                    <span className="detail-value">{formatTime(booking.bookingTime)}</span>
                  </div>
                </div>

                {booking.city && (
                  <div className="detail-item">
                    <span className="detail-icon">üèôÔ∏è</span>
                    <div>
                      <span className="detail-label">City</span>
                      <span className="detail-value">{booking.city}</span>
                    </div>
                  </div>
                )}

                {booking.address && (
                  <div className="detail-item">
                    <span className="detail-icon">üìç</span>
                    <div>
                      <span className="detail-label">Address</span>
                      <span className="detail-value">{booking.address}</span>
                    </div>
                  </div>
                )}
              </div>

              {booking.notes && (
                <>
                  <div className="booking-divider"></div>
                  <div className="booking-notes">
                    <h4>Additional Notes</h4>
                    <p>{booking.notes}</p>
                  </div>
                </>
              )}

              <div className="booking-footer">
                <span className="booking-date">
                  Booked on: {formatDate(booking.createdAt)}
                </span>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default MyBookings;
